import Box from '@mui/material/Box';
import TextField from '@mui/material/TextField';

export const Search = () => {
   return (
      <Box
         component="form"
         sx={{
         '& > :not(style)': { m: 1, width: '25ch' },
         }}
      noValidate
      autoComplete="off"
      >
         <TextField style={{color:"white"}} id="standard-basic" label="Search Star Wars" variant="standard" />
      </Box>
   );
}
